    return(
        <div>
            <img src="{props.foto}" alt={props.nome}/>
            <h2>Nome: {props.nome}</h2>
            <h2>Idade: {props.idade}</h2>
            <p>Profissão: {props.profissao}</p>
        </div>
    );
}

